script: |
  super -f text -I q8236.spq | sort > q8236.out

inputs:
  - name: q8236.spq
    data: |
      SELECT DISTINCT 49 FROM tab2 (FORMAT parquet) WHERE NOT col2 NOT BETWEEN 54 * - 21 * + + col1 - + 63 + + col1 + + col0 AND + + col1;
  - name: tab2

outputs:
  - name: q8236.out
    data: |
      49
